apidoc/titan/android/TitanContext.html.body:
TitanContext
Singleton Pattern
since 1.0.0
概览
系统统一接口上下文，应用程序使用系统统一接口服务的全局接口。通过TitanContext可以访问：

DataAcqService 数据采集
EasyTouchService 悬浮球
EthernetService 以太网
ResetFactoryService 恢复出厂设置
SystemFunctionService 系统功能

等系统功能。
方法说明

构造方法

单例模式，不支持应用直接实例化，而是通过getContext(Context)接口获取实例。

getTitanContext

public static TitanContext getTitanContext(Context context)    
功能
获取TitanContext实例。
参数

context：应用上下文。

返回值
TitanContext唯一实例。

getService

public  T getService(@NonNull Class serviceType) throws ServiceNotFoundException
功能
获取统一接口远程服务在应用端的代理对象,通过服务代理对象访问系统功能。
参数

serviceType：服务代理对象类型，不可为null。枚举类型有：
DataAcqService.class
EasyTouchService.class
EthernetService.class
ResetFactoryService.class
SystemFunctionService.class



返回值
服务代理对象，由入参serviceType指定代理对象类型。
异常

ServiceNotFoundException： serviceType所指类型服务不存在时抛出此异常。

编程示例：
TitanContext titanContext = TitanContext.getTitanContext(context); 
 try {
     SystemFunctionService service = titanContext.getService(SystemFunctionService.class);
     ApplicationModule application = service.getFunction(ApplicationModule.class);
     AppSignInfo appSignInfo = application.getAppSignInfo("com.example.demo");
 } catch (ServiceNotFoundException e) {
     e.printStackTrace();
 } catch (ServiceDeathException e) {
     e.printStackTrace();
 } catch (RemoteExecuteException e) {
     e.printStackTrace();
 }

apidoc/titan/android/dataacq/DataAcqServ.body:
DataAcqService
extends titan.android.core.TitanService
since 1.0.0
概览
系统统一接口数据采集服务. 用于获取设备的统计量和状态量. 不能直接实例化DataAcqService，而是通过 TitanContext.getService(Class)接口, 传入参数 DataAcqService.class 获取采集服务代理对象. 
需要采集某一模块的统计量或状态量时，通过getComponent(Class) 接口获取对应模块的实例,入参为模块的类型, 如获取音频孔模块, 传入AudioJack.class, 如果远程采集服务未运行, 则抛出 ServiceDeathException异常. 
方法说明

构造方法

不支持应用直接实例化，而是通过TitanContext.getService(DataAcqService.class)接口获取实例。

getComponent

public  T getComponent(@NonNull Class clazz) throws ServiceDeathException, ServiceNotFoundException
功能
获取采集模块。
参数

clazz：服务代理对象类型，不可为null。枚举类型有：
AudioJack.class
Battery.class
Bluetooth.class
Camera.class
CPU.class
其他类型...



返回值
采集模块实例, 实例类型即为入参clazz指定的类型。
异常

ServiceNotFoundException： clazz所指模块类型不存在时抛出此异常。
ServiceDeathException：远程服务未运行时抛出

编程示例：
TitanContext titan = TitanContext.getTitanContext(context);
 try {
     DataAcqService dataAcq = titan.getService(DataAcqService.class);
     AudioJack audioJack = dataAcq.getComponent(AudioJack.class);
     // 获取音频头插入次数统计量
     long count = audioJack.getUsage(AudioJack.PLUG_COUNT);
 } catch (ServiceNotFoundException e) {
     e.printStackTrace();
 } catch (ServiceDeathException e) {
     e.printStackTrace();
 }

